import moment from "moment";

const constant = {
	filters: {
		dateToString(date) {
			return date ? moment(date).format("DD/MM/yyyy") : "";
		},
	},
	default_organization: "VCR",
	space: " ",
	keys: {
		save: "save",
		cancel: "cancel",
		file: "file",
		close: "close",
		confirmDelete: "confirmDelete",
		bytes: "bytes",
		toggle: "toggle",
		children: "children",
		select: "select",
		files: "files",
		upload: "upload",
		update: "update",
		tab: "tab",
		search: "search",
		value: "value",
		change: "change",
	},
	values: {
		interval: 100,
		DATE_RANGE_SEPARATOR: ",",
		MAX_LENGTH: 255,
	},
	length_process_name: 50,
	format: {
		vi_date: "DD/MM/yyyy",
	},
};
export default constant;
